<style>
html, body {
  margin: 0px;
  padding: 0px;
  border: 0px;
}

a {
  text-decoration: none;
  font: inherit;
  color: inherit;
}

a:hover {
  background-color: black;
  color: white;
}

.entry:after {
    display: block;
    content: "";
    clear: both;
}

ul {
  list-style: square;
}

#contact ul {
  list-style: none;
}

#container {
  padding: 30px 50px;
  font-family: monospace;
  background-color: white;
  width: 800px;
  margin: 0 auto 20px auto;
  position: relative;
  box-shadow: 7px 7px rgba(0, 0, 0, 0.2);
}

#contact {
  font-weight: bold;
  text-align: center;
  /* padding: 10px 0; */
  float: right;
}

.entry {
  padding: 10px 0;
}

.entry .title {
  font-weight: bold;
  font-size: 20px;
  float: left;
  width: 20%;
}

.entry .content {
  float: right;
  width: 80%;
}

@media print {
    size: A4;
    margin: 0mm;
    body: {
        background: none;
    }
    #container {
      padding: 0;
      margin: 0;
      box-shadow: 0 0;
      height: 100%;
    }
    #diz {
      display: none;
    }
}

h1 {
  margin: 0;
}

span.title {
  font-size: 12px;
  font-style: italic;
}

.content p {
  margin: 0;
}

h3 {
  margin: 0;
  font-size: 0.9em;
}
#diz {
  position: absolute;
  bottom: 0;
  left: 0;
  opacity: 0.5;
}
.clearfix {
  border: 0;
  margin: 0;
  padding: 0;
  clear: both;
}
